import $api from './http/api';

export const AddProduct = async (product) => {
    return $api
        .post(`${process.env.REACT_APP_SERVER_URL}/product/add`, product)
        .catch((err) => err);
};

export const FindAllProducts = async () => {
    return $api
        .post(`${process.env.REACT_APP_SERVER_URL}/product/add`, product)
        .catch((err) => err);
}
